const items = [];
const binaryData = $('Gmail Trigger').item.binary;
for (const key in binaryData) {
  if (key.startsWith('attachment_')) {
    // We create a new object where the binary data
    // is now inside a property called 'data'
    const newItem = {
      json: {
        fileName: binaryData[key].fileName,
        mimeType: binaryData[key].mimeType
      },
      binary: {
        data: binaryData[key] // The binary data is now consistently named 'data'
      }
    };
    items.push(newItem);
  }
}

return items;

// Получаем все элементы с данными фондов
const allItems = $input.all();

// Если нет элементов для обработки, возвращаем пустой массив
if (!allItems || allItems.length === 0) {
  return [];
}

// Берем данные Excel из первого элемента (они одинаковые для всех)
const firstItem = allItems[0].json;
const excelDataInput = firstItem.excelData;

// Преобразуем данные Excel в рабочий массив
let excelData;
if (typeof excelDataInput === 'string') {
  excelData = JSON.parse(excelDataInput);
} else if (Array.isArray(excelDataInput)) {
  // Если это уже массив, делаем глубокую копию
  excelData = JSON.parse(JSON.stringify(excelDataInput));
} else {
  // Если это объект с массивом
  excelData = JSON.parse(JSON.stringify(excelDataInput));
}

// Вспомогательная функция для нормализации дат
function getReportMonth(dateString) {
  if (!dateString) return null;

  const monthMap = {
    'jan': '01', 'feb': '02', 'mar': '03', 'apr': '04', 'may': '05', 'jun': '06',
    'jul': '07', 'aug': '08', 'sep': '09', 'oct': '10', 'nov': '11', 'dec': '12',
    'january': '01', 'february': '02', 'march': '03', 'april': '04', 'may': '05', 'june': '06',
    'july': '07', 'august': '08', 'september': '09', 'october': '10', 'november': '11', 'december': '12'
  };

  const parts = String(dateString).replace(',', '').toLowerCase().split(' ');
  let month = null, year = null;

  for (const part of parts) {
    if (monthMap[part]) {
      month = monthMap[part];
    }
    if (!isNaN(part) && part.length === 4) {
      year = part;
    }
  }

  return year && month ? `${year}-${month}` : null;
}

// Функция для добавления суффикса к имени фонда для группы
function getFundNameWithGroup(baseFundName, fileName) {
  if (!fileName) return baseFundName;

  // Извлекаем группу из имени файла (например, "ASKIEF Class A" из "ASKIEF Class A - USD_31-Jul-2025.pdf")
  // Или ищем паттерны типа "Class A", "Class B", "Class I", "Group A", "Group B" и т.д.
  const classMatch = fileName.match(/Class\s+([A-Z])/i);
  const groupMatch = fileName.match(/Group\s+([A-Z])/i);

  if (classMatch) {
    // Добавляем класс к имени фонда, если его еще нет
    const classLetter = classMatch[1].toUpperCase();
    if (!baseFundName.includes(`Class ${classLetter}`)) {
      return `${baseFundName} - Class ${classLetter}`;
    }
  } else if (groupMatch) {
    // Добавляем группу к имени фонда
    const groupLetter = groupMatch[1].toUpperCase();
    if (!baseFundName.includes(`Group ${groupLetter}`)) {
      return `${baseFundName} - Group ${groupLetter}`;
    }
  }

  return baseFundName;
}

// ===== ОСНОВНАЯ ЛОГИКА =====
// Обрабатываем КАЖДЫЙ элемент (каждое вложение)
for (const item of allItems) {
  const fundData = item.json.output;

  // Проверяем наличие необходимых данных
  if (!fundData || !fundData.fundName) {
    continue; // Пропускаем элемент без данных
  }

  // Получаем имя файла, если оно есть (для определения группы)
  const fileName = item.json.fileName || '';

  // Формируем имя фонда с учетом группы/класса
  const fundName = getFundNameWithGroup(fundData.fundName, fileName);

  // Получаем значение доходности
  let monthlyReturn = fundData.monthlyReturn;

  // Получаем месяц отчета
  const reportMonth = getReportMonth(fundData.reportDate);

  // Проверяем, что у нас есть все необходимые данные
  if (!fundName || !reportMonth || monthlyReturn === null || monthlyReturn === undefined) {
    console.log(`Пропускаем фонд: отсутствуют данные. fundName: ${fundName}, reportMonth: ${reportMonth}, monthlyReturn: ${monthlyReturn}`);
    continue;
  }

  // Конвертируем строковое значение в число, если необходимо
  if (typeof monthlyReturn === 'string') {
    monthlyReturn = parseFloat(monthlyReturn.replace(',', '.'));
  }

  // Проверяем, существует ли колонка для этого фонда
  let headers = excelData.length > 0 ? Object.keys(excelData[0]) : ['Date'];

  if (!headers.includes(fundName)) {
    // Добавляем новую колонку для фонда во все существующие строки
    for (const row of excelData) {
      row[fundName] = null;
    }
    headers.push(fundName);
  }

  // Ищем строку с нужным месяцем
  let reportRow = excelData.find(row => row.Date === reportMonth);

  if (!reportRow) {
    // Создаем новую строку для этого месяца
    reportRow = { Date: reportMonth };

    // Инициализируем все существующие колонки как null
    headers = excelData.length > 0 ? Object.keys(excelData[0]) : ['Date'];
    if (!headers.includes(fundName)) {
      headers.push(fundName);
    }

    for (const header of headers) {
      if (header !== 'Date') {
        reportRow[header] = null;
      }
    }

    excelData.push(reportRow);
  }

  // Записываем значение доходности
  reportRow[fundName] = monthlyReturn;

  console.log(`Обработан фонд: ${fundName}, месяц: ${reportMonth}, доходность: ${monthlyReturn}`);
}

// Сортируем строки по дате для удобства
excelData.sort((a, b) => {
  if (!a.Date || !b.Date) return 0;
  return a.Date.localeCompare(b.Date);
});

// Возвращаем обновленную таблицу
return excelData;

